function Project() {
  return (
    <article className="proj">
      <div className="container">
        <img></img>
        <div className="desc">
          <a href="github.com">Github</a>
          <h4>Description</h4>
          <p>Blah blah blah</p>
        </div>
      </div>
    </article>
  );
}

export default Project;
